script: |
  super -f text -I q12791.spq | sort > q12791.out

inputs:
  - name: q12791.spq
    data: |
      SELECT ALL + - col2 AS col0 FROM tab1 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN - 68 * - col0 * + 22 AND col2 + - - col0 * - - col2;
  - name: tab1

outputs:
  - name: q12791.out
    data: |
